import React, { Component } from "react";
import { Link, animateScroll as scroll } from "react-scroll";
import { makeStyles } from "@material-ui/core/styles";
import AppBar from "@material-ui/core/AppBar";
import Toolbar from "@material-ui/core/Toolbar";
import "./components.css";
import classnames from "./components.css";

export default class Navbar extends Component {
  constructor(props) {
    super(props);

    this.state = {
      prevScrollpos: window.pageYOffset,
      visible: true
    };
  }
  scrollToTop = () => {
    scroll.scrollToTop();
  };

  render() {
    const classes = makeStyles({
      root: {
        flexGrow: 1
      }
    });

    return (
      <div>
        <div>
          <div className="nav " />
          <div className="nav2 centered2">
            <Link to="home" spy={true} smooth={true} duration={500}>
              <div className="link">Home</div>
            </Link>
            <Link to="about" spy={true} smooth={true} duration={500}>
              <div className="link">About</div>
            </Link>
            <Link to="portfolio" spy={true} smooth={true} duration={500}>
              <div className="link">Projects</div>
            </Link>
            <Link to="experience" spy={true} smooth={true} duration={500}>
              <div className="link">Experiences</div>
            </Link>
            <Link to="misc" spy={true} smooth={true} duration={500}>
              <div className="link">Misc</div>
            </Link>

            <a
              className="link"
              href={require("../files/SungJoonParkResume.pdf")}
              target="SungJoonParkResume"
            >
              Resume
            </a>
          </div>
        </div>
        <nav
          className={classnames("navbar", {
            "navbar--hidden": !this.state.visible
          })}
        >
          <a href="#">Item 1</a>
          <a href="#">Item 2</a>
          <a href="#">Item 3</a>
        </nav>
      </div>
    );
  }
}
